<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>LGU Asuncion Portal</title>
    <style>
        * { box-sizing: border-box; margin: 0; padding: 0; }
        
        body { 
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif; 
            background-color: #f0f2f5; 
            height: 100vh;
            display: flex; 
            justify-content: center; 
            align-items: center; 
            overflow: hidden;
        }

        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
        }

        .animate { animation: fadeIn 0.5s ease-out; }
        
        .card { 
            background: white; 
            padding: 2.5rem; 
            border-radius: 20px; 
            box-shadow: 0 15px 35px rgba(0,0,0,0.1); 
            text-align: center; 
            width: 95%; 
            max-width: 500px; 
            max-height: 90vh; 
            overflow-y: auto; 
            display: flex;
            flex-direction: column;
            align-items: center;
            border: 1px solid #ddd;
        }

        .header-pic {
            width: 150px; 
            height: auto;
            margin-bottom: 20px;
            display: block;
        }

        h1 { color: #1a73e8; font-size: 26px; margin-bottom: 5px; text-transform: uppercase; font-weight: 800; }
        p { color: #555; font-size: 14px; margin-bottom: 25px; font-weight: 600; }

        .btn-blue {
            background-color: #1a73e8; 
            color: white !important; 
            padding: 15px;        
            border-radius: 12px;        
            text-decoration: none;     
            font-weight: bold;
            display: block;
            width: 100%; 
            margin: 8px 0; 
            transition: all 0.2s ease;
            border: none;
            cursor: pointer;
            text-align: center;
            font-size: 14px;
        }

        .btn-blue:hover {
            background-color: #1557b0;
            transform: scale(1.02);
        }

        .back-btn {
            background-color: #6c757d;
            width: 130px;
            font-size: 11px;
            margin-bottom: 20px;
            padding: 8px;
        }

        #mainPage, #subMenu { flex-direction: column; align-items: center; display: flex; width: 100%; }
        #subMenu { display: none; }

        #pdfViewer { 
            display: none; 
            width: 100%; 
            height: 100vh; 
            flex-direction: column; 
            background: white; 
            position: fixed; 
            top: 0; left: 0; z-index: 100;
        }
        
        iframe { width: 100%; flex-grow: 1; border: none; }

        .card::-webkit-scrollbar { width: 6px; }
        .card::-webkit-scrollbar-thumb { background: #ccc; border-radius: 10px; }
    </style>
</head>
